def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return None

    parts = input1.split('-')
    result = []

    for i, part in enumerate(parts):
        if i == 0:
            result.append(part)
        else:
            result.append(part.capitalize())

    return ''.join(result)
